const Navbar = () => {
    return (
        <nav className="navbar">
            <h1 href="/sdsd">L'avantage de la glace</h1>
            <div className="links">
                <a href="/">Home</a>
                <a href="/create">New Blog</a>
            </div>
        </nav>
    );
}
 
export default Navbar;
